import React, { useState } from 'react';

const Icons = {
  School: () => (
    <svg xmlns="http://www.w3.org/2000/svg" className="w-6 h-6" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <path d="M2 3h6a4 4 0 0 1 4 4v14a3 3 0 0 0-3-3H2z"/>
      <path d="M22 3h-6a4 4 0 0 0-4 4v14a3 3 0 0 1 3-3h7z"/>
    </svg>
  ),
  Building: () => (
    <svg xmlns="http://www.w3.org/2000/svg" className="w-6 h-6" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <rect x="4" y="2" width="16" height="20" rx="2" ry="2"/>
      <path d="M9 22v-4h6v4"/>
      <path d="M8 6h.01"/>
      <path d="M16 6h.01"/>
      <path d="M12 6h.01"/>
      <path d="M12 10h.01"/>
      <path d="M12 14h.01"/>
      <path d="M16 10h.01"/>
      <path d="M16 14h.01"/>
      <path d="M8 10h.01"/>
      <path d="M8 14h.01"/>
    </svg>
  ),
  Award: () => (
    <svg xmlns="http://www.w3.org/2000/svg" className="w-6 h-6" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <circle cx="12" cy="8" r="6"/>
      <path d="M15.477 12.89 17 22l-5-3-5 3 1.523-9.11"/>
    </svg>
  ),
  ChevronDown: () => (
    <svg xmlns="http://www.w3.org/2000/svg" className="w-5 h-5" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <path d="m6 9 6 6 6-6"/>
    </svg>
  )
};

const Education = () => {
  const [activeIndex, setActiveIndex] = useState(0);

  const educationData = [
    {
      institution: "Singapore Management University",
      degree: "Bachelor of Science (Information Systems)",
      duration: "Aug 2021 – Aug 2025 (Expected)",
      icon: <Icons.School />,
      details: {
        major: "Business Analytics",
        gpa: "2.68",
        highlights: [
          "Advanced coursework in AI and Machine Learning",
          "Specialization in Business Analytics",
          "Completed projects in GenAI solutions for URA",
          "Strong foundation in Web Development and Programming"
        ],
        keyCourses: [
          "Introduction to Artificial Intelligence",
          "Data Mining and Business Analytics",
          "Machine Learning & Applications",
          "Enterprise Solution Development"
        ]
      }
    },
    {
      institution: "Zhejiang University",
      degree: "International Exchange Program",
      duration: "Feb 2024 – Jul 2024",
      icon: <Icons.Building />,
      details: {
        department: "School of Public Affairs",
        courses: [
          "International Law and Relations",
          "China Public Finance",
          "Social Science and Cultural Hegemony",
          "Consumer Neuroscience",
          "Technology Entrepreneurship",
          "Academic Writing in Psychology"
        ]
      }
    },
    {
      institution: "Ngee Ann Polytechnic",
      degree: "Diploma in Business Information Technology",
      duration: "Jan 2016 - Dec 2019",
      icon: <Icons.Award />,
      details: {
        achievements: [
          "Tai Sin Prize for Most Outstanding Performance during '6-Month Internship'",
          "Participated in National Economics & Financial Management Challenge",
          "Part of Harvard Business School Mentorship Program"
        ]
      }
    }
  ];

  return (
    <div className="max-w-4xl mx-auto p-6">
      <div className="text-center mb-8">
        <h1 className="text-3xl font-bold mb-4">Education Journey</h1>
        <div className="w-24 h-1 bg-yellow-400 mx-auto"></div>
      </div>

      <div className="space-y-6">
        {educationData.map((edu, index) => (
          <div 
            key={index}
            className={`bg-white rounded-lg shadow-md transition-all duration-300 hover:shadow-lg ${
              activeIndex === index ? 'border-yellow-400 border-2' : 'border border-gray-200'
            }`}
          >
            <div
              className="p-4 cursor-pointer"
              onClick={() => setActiveIndex(activeIndex === index ? -1 : index)}
            >
              <div className="flex items-center gap-4">
                <div className="p-2 bg-yellow-100 rounded-full">
                  {edu.icon}
                </div>
                <div className="flex-1">
                  <h2 className="text-xl font-semibold">{edu.institution}</h2>
                  <p className="text-gray-600">{edu.degree}</p>
                  <p className="text-sm text-gray-500">{edu.duration}</p>
                </div>
                <div className={`transform transition-transform duration-300 ${
                  activeIndex === index ? 'rotate-180' : ''
                }`}>
                  <Icons.ChevronDown />
                </div>
              </div>
            </div>

            {activeIndex === index && (
              <div className="border-t border-gray-200">
                <div className="p-4 space-y-4">
                  {edu.details.major && (
                    <div>
                      <h3 className="font-semibold">Major</h3>
                      <p>{edu.details.major}</p>
                    </div>
                  )}

                  {edu.details.gpa && (
                    <div>
                      <h3 className="font-semibold">Cumulative GPA</h3>
                      <p>{edu.details.gpa}</p>
                    </div>
                  )}

                  {edu.details.highlights && (
                    <div>
                      <h3 className="font-semibold">Academic Highlights</h3>
                      <ul className="list-disc pl-5 space-y-1">
                        {edu.details.highlights.map((highlight, i) => (
                          <li key={i} className="text-gray-600">{highlight}</li>
                        ))}
                      </ul>
                    </div>
                  )}

                  {edu.details.keyCourses && (
                    <div>
                      <h3 className="font-semibold">Key Courses</h3>
                      <ul className="list-disc pl-5 space-y-1">
                        {edu.details.keyCourses.map((course, i) => (
                          <li key={i} className="text-gray-600">{course}</li>
                        ))}
                      </ul>
                    </div>
                  )}

                  {edu.details.courses && (
                    <div>
                      <h3 className="font-semibold">Exchange Courses</h3>
                      <ul className="list-disc pl-5 space-y-1">
                        {edu.details.courses.map((course, i) => (
                          <li key={i} className="text-gray-600">{course}</li>
                        ))}
                      </ul>
                    </div>
                  )}

                  {edu.details.achievements && (
                    <div>
                      <h3 className="font-semibold">Achievements</h3>
                      <ul className="list-disc pl-5 space-y-1">
                        {edu.details.achievements.map((achievement, i) => (
                          <li key={i} className="text-gray-600">{achievement}</li>
                        ))}
                      </ul>
                    </div>
                  )}
                </div>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Education;
